import React from 'react';

class Recommendation extends React.Component{

    render(){
        return(
            <>
             <div>
                <h3>Recommendation</h3>
                <Stage1Output data={[[{},{},{}],[{},{}]]} />
            </div>
            </>)
    }

}

function Stage1Output(props){

    const features = props.data.map((val)=>{
      return  (<div className="row w3-margin">
                      <div className="w3-half w3-red">Sex</div>
                      <div className="w3-half w3-red">Sex</div>
             </div>)
    })

    return (
        <>
            <div>
            <div className="w3-container w3-padding-32 " style={{margin:"32px 0"}}>
                 <h4>Enconding</h4>
                 {features}
            </div>
            </div>
        </>
    )
}

export default Recommendation;
